import React from 'react';
import MainPageHeader from './mainPage_header';
import MyPageMenu from './myPage_menu';

function MainPage() {
  return (
    <div>
      <MainPageHeader />
      <MyPageCategory />
      <div className="mypage-body">
        <div className="menu-wrapper">
          <MyPageMenu />
        </div>
      </div>
    </div>
  );
}

export default MainPage;
